from math import isqrt
from sympy import isprime
from itertools import count
def f(m): return sum((m+i)**2 for i in range(6))
def a(n):
    b = 10**(n-1)
    m = isqrt(b//6) - 5
    return next(t for i in count(m) if (t:=f(i)) >= b and isprime(t))
